import React, { Component } from 'react'
import {useSpring , animated} from 'react-spring';

export default class App extends Component {
  render() {
    const props = useSpring({
      opacity: 1,
      from: { opacity: 0 },
    })
    return <animated.h1 style={props}>hello</animated.h1>
  }
}
